import classes from "./InfoBox.module.css"
export const InfoBox = (title:string,children: any) => {
  return (
  <div className= {classes.InfoBox}>
      <div className= {classes.InfoBoxHeader}>
           {title}
      </div>
      <div className= {classes.InfoBoxContent}>
         {props.children}
      </div>
  </div>)
}
